    const params = useParams()
    const [search, setSearch] = useState({})
    useEffect(() => {

        AxiosInstance.get(`/search/movie?api_key=addc24fa3de68655222e36f0796cadb2&query={${props.search}}`)
            .then((res) => setSearch(res.data))
            .catch((err) => console.log(err))
    }, [])
